import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useParams } from 'react-router-dom';
import { AuthService } from './AuthService ';
import axios from 'axios';


export default function UserProfile(){

    const {id}=useParams();
    const {uId}=useParams();

    const[user,setUser]=useState([]);
    const getUser=()=>{

        axios.get('http://localhost:6060/User/get/'+uId)
        .then((res) => {
            console.log(res.data);
            setUser(res.data.Vehicle);
            
        })
        .catch((err) => {
            alert(err.message);
        }); 
    };

    useEffect(() => {
        getUser();
        
    }, []);



    const handleLogout = () => {
        AuthService.logout(); // Call the logout method from AuthService
        window.location.href = '/'; // Redirect to the  page after logout
       };
        // Correct usage of AuthService
        const isLoggedIn = AuthService.isLoggedIn();
  
        useEffect(() => {
          if (!isLoggedIn) {
          // Redirect to  if user is not logged in
          window.location.href = '/';
          }
        }, [isLoggedIn]);

    return(

        <div className='ppage'>
            <nav style={{ background: "#333333",height:"60px" }} className="navbar navbar-expand-lg navbar-light">
        <a style={{marginLeft:"10px",color:"whitesmoke",fontStyle:"italic",fontSize:"26px"}} className="navbar-brand" href="#">car<span style={{color:"#fe5b29"}}>H</span>ub</a>
      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarNav">
        <ul className="navbar-nav">
          <li className="nav-item active">
            <a style={{color:"whitesmoke"}} className="nav-link" href={`/index/${uId}`}>Home <span className="sr-only">(current)</span></a>
          </li>
          <li className="nav-item">
            <a style={{color:"whitesmoke"}} className="nav-link" href={`/vehi/${uId}`}>Vehicles</a>
          </li>
          <li className="nav-item">
            <a style={{color:"whitesmoke"}}  className="nav-link" href="/reg">about Us</a>
          </li>
          <li className="nav-item">
            <a style={{color:"whitesmoke"}} className="nav-link" href={`/profile/${uId}`}>Contact Us</a>
          </li>
        </ul>
        <button type="submit" onClick={handleLogout} style={{width:"100px", marginTop:"20px",marginLeft:"-85px", backgroundColor:"#fe5b29",marginLeft:"59%"}} class="btn btn-primary mb-3" id="submit">Sign In</button>
      </div>
    </nav>
            <div class="profile-container1">
        <div class="profile-info1">
            <label className='lb' for="image">Image:</label>
           
            
        </div>

        <div class="profile-info1">
            <label className='lb' for="email">Email:</label>
            <div>{ user.email }</div>
        </div>

        <div class="profile-info1">
            <label className='lb' for="name">Name:</label>
            <div>{ user.name }</div>
        </div>

        <div class="profile-info1">
            <label className='lb' for="address">Address:</label>
            <div>{user.address }</div>
        </div>

        <div class="profile-info1">
            <label className='lb' for="nic">NIC:</label>
            <div>{user.nic }</div>
        </div>

        <div class="profile-info1">
            <label className='lb' for="contactno">Contact Number:</label>
            <div>{ user.contactno }</div>
        </div>

        <div class="profile-info1">
            <label className='lb' for="gender">Gender:</label>
            <div>{ user.gender }</div>
        </div>

        <button className='bbtn'>Edit Profile</button>
        </div>
        </div>
    )
}
